import React from 'react'
import "./ContenidoAyuda.scss";

export default function ContenidoAyuda() {
    return (
        <div className="ayuda" id="ayudaEjemplo">
            <div className="ayuda-item">
                <h2 className="ayuda-header" id="ayudaUno">
                    <button className="ayuda-button" type="button">
                        Video Tutoriales
                        <a href='https://'/>
                    </button>
                </h2>
            </div>
        </div>
    )
}
